import { Button } from "@material-ui/core";

const FollowProfileButton =()=>{

    return (
        <div>
        <Button
          variant="contained"
          color="primary"
          size="large"
        //   startIcon={<SaveIcon />}
          type="submit"
        >
          Follow
        </Button>
        <Button
          variant="contained"
          color="secondary"
          size="large"
        //   startIcon={<SaveIcon />}
          type="submit"
        >
          Unfollow
        </Button>
      </div>
    )
}

export default FollowProfileButton
